import React from 'react';
import './header.css';
import { Navbar, Container} from 'react-bootstrap'

class HeaderForm extends React.Component{
    render(){
      return(

        <Navbar>
            <Container>
                <a href="#"> My portfolio </a>
                <ul>
                <a href="/"> About </a>

                <a href="/home"> Hpme </a>
                <a href="/"> Resume </a>
                <a href="/"> Contact </a>

                </ul>

        </Container>
        </Navbar>
      )

    }
}
export default HeaderForm;
